import React, { useState } from 'react';

function StaffRegistration() {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [phone, setPhone] = useState('');
  const [address, setAddress] = useState('');
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [message, setMessage] = useState('');
  const [stafftype, setStafftype] = useState('');


  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await fetch("http://localhost:5000/reg/stf", {
        method: "POST",
        headers: {
          "Content-Type": "application/json"
        },
        body: JSON.stringify({
          stfName: name,
          stfEmail: email,
          stfPhone: phone,
          stfAddress: address,
          stfUserName: username,
          stfPassword: password,
          stfType:stafftype
        })
      });

      const data = await response.json();

      if (response.ok) {
        setMessage(data.message);
      } else {
        setMessage(data.message);
      }
    } catch (error) {
      console.error("Error during staff registration:", error);
    }
  };

  return (
    <div className="container mx-auto py-8">
      <h1 className="text-2xl font-bold mb-4">Staff Registration</h1>
      <form onSubmit={handleSubmit}>
        <div className="mb-4">
          <label htmlFor="name" className="block text-gray-700 font-bold mb-2">Name:</label>
          <input type="text" id="name" value={name} onChange={(e) => setName(e.target.value)} required className="border border-gray-400 rounded py-2 px-3 w-full" />
        </div>

        <div className="mb-4">
          <label htmlFor="email" className="block text-gray-700 font-bold mb-2">Email:</label>
          <input type="email" id="email" value={email} onChange={(e) => setEmail(e.target.value)} required className="border border-gray-400 rounded py-2 px-3 w-full" />
        </div>

        <div className="mb-4">
          <label htmlFor="phone" className="block text-gray-700 font-bold mb-2">Phone:</label>
          <input type="text" id="phone" value={phone} onChange={(e) => setPhone(e.target.value)} required className="border border-gray-400 rounded py-2 px-3 w-full" />
        </div>

        <div className="mb-4">
          <label htmlFor="address" className="block text-gray-700 font-bold mb-2">Address:</label>
          <input type="text" id="address" value={address} onChange={(e) => setAddress(e.target.value)} required className="border border-gray-400 rounded py-2 px-3 w-full" />
        </div>

        <div className="mb-4">
          <label htmlFor="username" className="block text-gray-700 font-bold mb-2">Username:</label>
          <input type="text" id="username" value={username} onChange={(e) => setUsername(e.target.value)} required className="border border-gray-400 rounded py-2 px-3 w-full" />
        </div>

        <div className="mb-4">
          <label htmlFor="password" className="block text-gray-700 font-bold mb-2">Password:</label>
          <input type="password" id="password" value={password} onChange={(e) => setPassword(e.target.value)} required className="border border-gray-400 rounded py-2 px-3 w-full" />
        </div>
        <div className="mb-4">
    <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="userRole">
      Staff Role
    </label>
    <select
      className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
      id="userRole"
      value={staff.stafftype}
      onChange={(e) => setUser({ ...staff, stafftype: e.target.value })}
    >
      <option value="">Select</option>
      <option value="Staff">Staff</option>
      <option value="Doctor">Doctor</option>
      {/* Add more role options if needed */}
    </select>
  </div>

        <div className="mb-4">
          <input type="submit" value="Register" className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded" />
        </div>
      </form>
      {message && <p className="text-red-500">{message}</p>}
    </div>
  );
}

export default StaffRegistration;
